notes:
- This specification is not final and is subject to change.
- A `serialVersionUID` field in an interface is ineffectual. Do not use; no replacement.
- Extension mechanism is no longer supported.
- Initialization of this field is prone to deadlocks.
- Uses OAuth2 with refresh token â€” requires setup of connected app in api
- Some objects like Contact may return nulls in deeply nested fields
- This method has plain memory effects but the method name implies volatile memory
  effects.
- To avoid confusion over plain or volatile memory effects it is recommended to use
  weakCompareAndSetPlain.
- It is rarely appropriate to use this constructor.
- Use `Double.parseDouble(String)` to convert a string to a `double` primitive, or
  use `Double.valueOf(String)` to convert a string to a `Double` object.
- It is rarely appropriate to use this constructor. Instead, use the static factory
  method `Float.valueOf(float)`.
- It is rarely appropriate to use this constructor. The static factory `Integer.valueOf(int)`
  is generally a better choice.
- It is rarely appropriate to use this constructor. The static factory `Long.valueOf(long)`
  is generally a better choice.
- It is rarely appropriate to use this constructor. The static factory `Short.valueOf(short)`
  is generally a better choice.
- This method does not properly convert bytes into characters. As of JDK 1.1, the
  preferred way to do this is via the `String` constructors that take a `Charset`,
  charset name, or that use the `default charset`.
- Release 7 is obsolete; update to a visitor for a newer release level.
- Finalizer invocations are not automatically chained, unlike constructors.
- Serialized objects of this class will not be compatible with future Swing releases.
- Invoking Object's clone method on an instance that does not implement the Cloneable
  interface results in the exception CloneNotSupportedException being thrown.
- By convention, classes that implement this interface should override Object.clone
  with a public method.
- Deserialization of untrusted data is inherently dangerous and should be avoided.
- Serializable classes that need to designate an alternative object to be used when
  writing an object to the stream should implement this special method.
- Acts on the 'home' key event or equivalent event.
- As of Java 2 platform v1.3 this undocumented class is no longer used.
- The current serialization support is appropriate for short term storage or RMI between
  applications running the same version of Swing.
- Can be used to insert an arbitrary string of HTML into an existing HTML document.
- 'Requires at least two HTML Tags: parentTag and addTag.'
- Release 6 is obsolete; update to a visitor for a newer release level.
- Use EmptyBorder to create a plain border
- Use CompoundBorder to nest multiple border objects
